import React from "react";
import { useParams } from "react-router";
import { useSelector } from "react-redux";
import { useDispatch } from "react-redux";
import { useEffect } from "react";
import { getProjects } from "../../actions/project";
import ProjectSummaryHeader from "./ProjectSummaryHeader";
import ProjectSummaryDashboard from "./ProjectSummaryDashboard";
import { Redirect } from "react-router-dom";

const ProjectSummary = () => {
  const { pid } = useParams();
  console.log("PID:");
  console.log(pid);
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getProjects())
      .then((response) => {
        console.log("Projects fetched successfully for summary");
      })
      .catch(() => {
        console.log("Unable to fetch projects for summary");
      });
  }, [dispatch]);
  if(pid === undefined){
    console.log("Cmon, redirect!");
    return(<Redirect to="/projects" />);
  }

  const { projects: content } = useSelector((state) => state.project);

  return (
    <div>
      <ProjectSummaryHeader />
      <br />
      <ProjectSummaryDashboard id={pid} content={content} />
    </div>
  );
};

export default ProjectSummary;
